import logo from './logo.svg';
import './App.css';
import { Route, Routes } from "react-router-dom";
import React from "react"
import Create from './components/create';

function App() {
  return (
    <div>
      <Routes>
        <Route exact path="/" element={<Create />} />
      </Routes>
    </div>
  );
}

export default App;
